import React from 'react';
import Navbar from './components/Navbar';
import LanguageFolders from './components/LanguageFolders';
import './styles/App.css';

function App() {
    return (
        <div className="App">
            <Navbar />
            <h1>Language You Love</h1>
            <LanguageFolders />
        </div>
    );
}

export default App;
